import React, { useEffect, useState } from 'react';
import { supabase } from '../supabaseClient';

const HomePage = () => {
  const [products, setProducts] = useState([]);

  useEffect(() => {
    const fetchProducts = async () => {
      const { data } = await supabase.from('products').select('*');
      if (data) setProducts(data);
    };
    fetchProducts();
  }, []);

  return (
    <div style={{ backgroundColor: '#F9F9F9', minHeight: '100vh', fontFamily: 'Arial, sans-serif' }}>
      
      {/* Hero Banner */}
      <div style={{ backgroundColor: '#212121', color: 'white', padding: '60px 50px', marginBottom: '40px', borderRadius: '0 0 50px 50px', display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
        <div>
          <h2 style={{ fontSize: '40px', marginBottom: '10px' }}>Best Mobile <br/> <span style={{ color: '#008ECC' }}>Accessories</span></h2>
          <p style={{ opacity: 0.8 }}>Up to 80% OFF on all premium brands</p>
        </div>
        <div style={{ fontSize: '80px', opacity: 0.2 }}>ðŸ“±</div>
      </div>

      {/* Main Content */}
      <div style={{ maxWidth: '1200px', margin: '0 auto', padding: '0 20px' }}>
        <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginBottom: '20px' }}>
          <h3 style={{ fontSize: '20px', fontWeight: 'bold' }}>Grab the best deal on <span style={{ color: '#008ECC' }}>Smartphones</span></h3>
          <span style={{ color: '#008ECC', fontWeight: 'bold', cursor: 'pointer' }}>View All {'>'}</span>
        </div>

        {/* Grid */}
        <div style={{ display: 'grid', gridTemplateColumns: 'repeat(auto-fill, minmax(220px, 1fr))', gap: '25px' }}>
          {products.map((item) => (
            <div key={item.id} style={{ backgroundColor: '#fff', borderRadius: '16px', padding: '15px', position: 'relative', border: '1px solid #eee', transition: 'transform 0.2s' }}>
              
              {/* The "Blue Ribbon" Discount */}
              <div style={{ position: 'absolute', top: 0, right: 0, backgroundColor: '#008ECC', color: '#fff', padding: '8px 12px', borderBottomLeftRadius: '20px', fontSize: '12px', fontWeight: 'bold' }}>
                10% OFF
              </div>

              <div style={{ height: '180px', display: 'flex', alignItems: 'center', justifyContent: 'center', backgroundColor: '#fcfcfc', borderRadius: '12px', marginBottom: '15px' }}>
                <img src={item.image_url} alt={item.name} style={{ maxHeight: '140px', maxWidth: '100%' }} />
              </div>

              <h4 style={{ fontSize: '14px', marginBottom: '8px', color: '#444', height: '40px', overflow: 'hidden' }}>{item.name}</h4>
              <div style={{ display: 'flex', alignItems: 'center', gap: '10px' }}>
                <span style={{ fontSize: '18px', fontWeight: 'bold' }}>RWF {item.price.toLocaleString()}</span>
              </div>
              
              <button style={{ width: '100%', marginTop: '15px', backgroundColor: '#008ECC', color: 'white', border: 'none', padding: '12px', borderRadius: '10px', fontWeight: 'bold', cursor: 'pointer' }}>
                Add to Cart
              </button>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default HomePage;
